script: |
  super -f text -I q5606.spq | sort > q5606.out

inputs:
  - name: q5606.spq
    data: |
      SELECT * FROM tab0 (FORMAT parquet) WHERE + 53 NOT BETWEEN + - col0 * 97 + + ( col0 ) + - col1 AND - col0;
  - name: tab0

outputs:
  - name: q5606.out
    data: |
      15	81	47
      87	21	10
      97	1	99
